import './App.css';
import uuid from 'react-uuid'
import React, { useState } from 'react';

function App() {

    const [checked, setChecked] = useState(true);

    function old (age) {
        if (age) {
          return  <div>
                    <h2>Ура, вам уже есть 18</h2>
                    <p>
                        здесь расположен контент только для взрослых
                    </p>
            </div>
        } else {
          return  <div>
                    <p>
                        увы, вам еще нет 18 лет:(
                    </p>
            </div>
        }

    }


    return <div>
        <input  type = "checkbox" checked = {checked} onChange = {() => setChecked(false)}/>
        <p>{old(checked)}</p>
    </div>

}


export default App;
